**Fizz Buzz Implementation**
=========================

### JavaScript Implementation
````javascript
/**
 * Plays fizz-bzz until `max` value
 *
 * If `i` mod 3 == 0, print `fiz`.
 * If `i` mod `5 == 0`, print `bzz`.
 * Else print `i`.
 */
function fizzBuzz(max) {
    for (let i = 1; i <= max; i++) {
        if (i%15 === 0){
            console.log("FizzBuzz")
        } else if (i %3 === 0) {
            console.log("Fizz");
        } else if (i % 5 === 0) {
            console.log("Buzz");
        } else {
            console.log(i);
        }
    }
}

// Example Usage: Fizz Buzz until `100`
fizzBuzz(50)
